import React from 'react'

const UserList = (props) => {
  const userName = props.userData[0].name
  const userAge = props.userData[0].age

  return (
    <div>
      <div>
        <p>{`${userName} (${userAge} years old)`}</p>
      </div>
    </div>
  )
}

export default UserList
